stabilizers = stabilizers_raw.strip().split('\n')
n_qubits = 135

# Check commutativity and find anticommuting pairs
def commutes(s1, s2):
    collisions = 0
    for c1, c2 in zip(s1, s2):
        if c1 != 'I' and c2 != 'I' and c1 != c2:
            collisions += 1
    return collisions % 2 == 0

anticomm = []
for i in range(len(stabilizers)):
    for j in range(i+1, len(stabilizers)):
        if not commutes(stabilizers[i], stabilizers[j]):
            anticomm.append((i, j))

print(f"Found {len(anticomm)} anticommuting pairs")
for pair in anticomm[:20]:
    print(f"  {pair}")

# Try a greedy approach to find maximal commuting set
included = set()
excluded = set()

# First add all stabilizers that commute with everything
for i in range(len(stabilizers)):
    conflicts = [j for (a, b) in anticomm if (a == i or b == i) for j in [a, b] if j != i]
    if not conflicts:
        included.add(i)

print(f"\nStabilizers that commute with everything: {len(included)}")

# Now greedily add stabilizers
remaining = set(range(len(stabilizers))) - included
for i in sorted(remaining):
    conflicts = [j for (a, b) in anticomm if (a == i or b == i) for j in [a, b] if j != i]
    if all(c not in included for c in conflicts):
        included.add(i)

print(f"Total stabilizers in commuting set: {len(included)}")
print(f"Included indices: {sorted(included)[:50]}...")
